import React from 'react';
import { Fetch } from 'react-request';
import console from "react-console";

const name = "Chris";

export default class AlphaRequest extends React.Component {
  render() {
    return (
        <Fetch url="https://polisen.se/api/events?2020-01-05&locationname=Stockholm&type=Alkohollagen">
        {({ fetching, failed, data }) => {
          if (fetching) {
            return <div>Loading data...</div>;
          }

          if (failed) {
            return <div>The request did not succeed.</div>;
          }

          if (data) {
            return (
              <div>
                <div>Post ID: {data.id}</div>
               <p>{name}</p> 
              </div>
            );
          }
          return null;
        }}
      </Fetch>
    );
  }
}
